The dog was originally bred in Germany in 1899 for herding flocks all day. German shepherds,like other working dogs, thrive on having a job to do-any job. They are highly energetic and if not given enough exercise they will become bored...and let‚Äôs just say your favorite pair of shoes won‚Äôt be in good shape!
Unfortunately these dogs often have the hereditary condition known as Hip Dysplasia. This condition is a result of the femur not fitting snugly into the pelvic socket of the hip joint.This improper fit results in grinding of the joints which leads them to deteriorate. This can cause these dogs a lot of discomfort especially in their older age.
If you are a thief, it is probably not in your best interest to enter an enclosure guarded by a German Shepherd. Weighing up to 95 pounds of pure muscle, this animal is absolutely fearless and is not afraid to protect their territory. Their heavy bark alone is enough to send any intruder running out the door wishing they had stayed in college.
